import { Input } from 'antd';
import './styleJobOpening.css';

function jobOpening(props) {
  return (
    <div className="jopOpenings-body">
      <div className="jopOpenings-header">
        <h3>Job openings</h3>
      </div>

      <div className="jopOpenings-title">
        <p>
          <span className="jopOpening-welcome">Welcome!</span> <br /> We want
          people to thrive. We believe you do your best work when you feel your
          best.
        </p>
      </div>

      <Search
        placeholder="input search text"
        onSearch={props.onSearch}
        style={{
          width: 200,
          float: `right`,
          //   marginRight: `1%`,
        }}
        className="job-search"
      />
    </div>
  );
}

export default jobOpening;
